import * as api from '../api';

const createAppointment = (newAppointment) => async (dispatch) => {
    try {
        const { data } = await api.createAppointment(newAppointment);

        dispatch ({ type: 'CREATE' , payload: data });
    } catch (error) {
        console.log(error.message)
    }
}

export default createAppointment;
